import React from 'react';
import ProductCard from './ProductCard';
import './ProductList.css';

const games = [
  {
    id: 1,
    name: 'Elden Ring',
    image: 'https://static-cdn.jtvnw.net/ttv-boxart/516575-272x380.jpg',
    price: 59.99,
    rating: 5
  },
  {
    id: 2,
    name: 'Final Fantasy 16',
    image: 'https://static-cdn.jtvnw.net/ttv-boxart/514625-272x380.jpg',
    price: 69.99,
    rating: 4
  },
  {
    id: 3,
    name: 'Pokemon Scarlet',
    image: 'https://static-cdn.jtvnw.net/ttv-boxart/518228-272x380.jpg',
    price: 49.99,
    rating: 4
  },
  {
    id: 4,
    name: 'Demon Souls',
    image: 'https://static-cdn.jtvnw.net/ttv-boxart/508791-272x380.jpg',
    price: 59.99,
    rating: 5
  },
  {
    id: 5,
    name: 'GTA V',
    image: 'https://static-cdn.jtvnw.net/ttv-boxart/32982-272x380.jpg',
    price: 29.99,
    rating: 4
  },
  {
    id: 6,
    name: 'FC 24',
    image: 'https://static-cdn.jtvnw.net/ttv-boxart/21779_IGDB-272x380.jpg',
    price: 59.99,
    rating: 3
  },
  {
    id: 7,
    name: 'Madden 25',
    image: 'https://static-cdn.jtvnw.net/ttv-boxart/136024-272x380.jpg',
    price: 59.99,
    rating: 3
  },
  {
    id: 8,
    name: 'Civilization 6',
    image: 'https://static-cdn.jtvnw.net/ttv-boxart/18828-272x380.jpg',
    price: 39.99,
    rating: 4
  }
];

function ProductList() {
  return (
    <div className="product-list">
      {games.map(game => (
        <ProductCard
          key={game.id}
          name={game.name}
          image={game.image}
          price={game.price}
          rating={game.rating}
        />
      ))}
    </div>
  );
}

export default ProductList;
